{'enable_order_book': False, 'active': True, 'closed': True, 'archived': False, 'accepting_orders': False, 'accepting_order_timestamp': None, 'minimum_order_size': 15, 'minimum_tick_size': 0.01, 'condition_id': '0x9cc8bbc6ae0f356b0c99ef862bd49577f168645da938911549da68f5ba049649', 'question_id': '0x9e93022870e76a06cbc12e86902d66f444112eb33fff43010af6af80976f5179', 'question': 'zkSync airdrop by June 1?', 'description': 'This is a market on whether zkSync (https://zksync.io/) will both launch and airdrop a native token by June 1, 2023, 11:59:59 PM ET. Launching a token in this context can be defined as a deployed-to-mainnet, actively transferrable and/or tradable token that is in some way native to the underlying application or protocol, and substantiated by the respective project via website or official social media channels. In the case of a token being announced but not yet transferrable or “live”, that will not satisfy market conditions. If the token is deployed to mainnet, but is not transferrable, that will also not satisfy market conditions. In the case of ERC20 tokens, if the token is deployed, but there is no existing Uniswap pool for the token, it will be considered not “live” and thus will not satisfy market conditions. For clarity, this market is about fungible tokens, and not NFTs related to a platform.

Airdrop in this context means that a nonzero portion of this token’s supply must have been distributed for free to at least one subset of actors relevant to the underlying project, based on their retroactive, past participation in using the product or protocol, participating in the community, or some other non-transactional action that pertains to the underlying project. An airdrop is considered to have taken place if the aforementioned free token distribution occurs, regardless of lockups or restrictions on the ability to sell the airdropped token, as long as the underlying token itself is live as per the earlier definition.

If this project launches a token and performs an airdrop by June 1, 2023, 11:59:59 PM ET, this market will resolve to “Yes”. If one or both of the objectives are not met by the resolution date, the market resolves to “No”.', 'market_slug': 'zksync-airdrop-by-june-1', 'end_date_iso': '2023-06-01T00:00:00Z', 'game_start_time': None, 'seconds_delay': 0, 'fpmm': '0x54ab8b453dC1b64471184cFE1ee2EED04C7a5594', 'maker_base_fee': 0, 'taker_base_fee': 0, 'notifications_enabled': True, 'neg_risk': False, 'neg_risk_market_id': '', 'neg_risk_request_id': '', 'icon': 'https://polymarket-upload.s3.us-east-2.amazonaws.com/zksync.jpeg', 'image': 'https://polymarket-upload.s3.us-east-2.amazonaws.com/zksync.jpeg', 'rewards': {'rates': None, 'min_size': 0, 'max_spread': 0}, 'is_50_50_outcome': False, 'tokens': [{'token_id': '64530256692770493741616758329004232452735267114796932386033501933292886503388', 'outcome': 'Yes', 'price': 0, 'winner': False}, {'token_id': '21201129739587299147275727753263534641072025588284106584050292878396252335735', 'outcome': 'No', 'price': 1, 'winner': True}], 'tags': ['All']}

